import { Navigate, Route } from 'react-router-dom';

const ProtectedRoute = ({ element, isLoggedIn, ...props }) => {
  return isLoggedIn ? (
    <Route {...props} element={element} />
  ) : (
    <Navigate to="/sign-in" />
  );
};

export default ProtectedRoute;
